INSERT INTO `message_templates` (`id`, `name`, `template`, `type`) VALUES ('0b5cd4b9-ff79-4d39-9ca8-0d975ddbea29','CORREO DE LA PROFESORA','Estimados padres:\r\nhemos enviado un correo electrónico a su dirección de correo recientemente. Rogamos lo lean cuanto antes.\r\nUn saludo!','sms'),('22c389e0-696d-4a5c-849f-c164a62cd212','NO RECUPERAN ON LINE','Academia Britannia. Seguimos recuperando las clases de marzo on-line. No os perdáis la de hoy. cualquier duda. britannia.elpuerto@gmail.com. La dirección.','sms'),('41a1051c-5d50-4524-b8bf-0b90b3a74bda','Pendiente de respuesta. revise correo','A.Britannia. No hemos recibido respuesta a últimos emails. Para saber si están informados,agradecemos lo hagan. para dudas escriban un email, le podemos llamar','sms'),('5e1384eb-022a-4b15-8a18-194c12db741f','RECIBOS PENDIENTES','ACADEMIA BRITANNIA. LE RECORDAMOS QUE TIENE PENDIENTE SU RECIBO. DOMICILIE SUS PAGOS PARA MAYOR COMODIDAD. PREGUNTEN EN RECEPCIÓN. MUCHAS GRACIAS Y UN SALUDO.','sms'),('68cd6047-0d57-486e-b1fd-4a1ce0bfde2b','RECUPERACIÓN MARZO PEQUES','Academia Britannia, manda sms para que revisen email recuperación clases online y respondan en el mismo email.Revisen carpeta de SPAM si no les aparece.Gracias','sms'),('8fe4d9dd-1ac7-4dc0-b4ce-7c15d6d1e4c8','EMAIL NO RECIBIDO','Academia Britannia, os estamos mandando emails, revisen sus carpetas de spam/correo no deseado,pueden estar ahi, os seguiremos informando.Un abrazo virtual.','sms'),('a79e16f9-7385-444f-8dfb-9ff803113463','Recibos','<p>Adjuntamos en recibo del mes en curso. <br></p><p>Muchas gracias por seguir confiando en nosotros.</p><p><br></p><p><br></p><p>Atentamente</p><p>La dirección<br></p>','email'),('c465e276-7903-4274-adbc-73d769fd252e','sms. b1 adultos','Academia Britannia. Le recordamos que el día 10/04/2020 tiene su clase on line, tiene la info en su email. Rogamos respondan al email. Un saludo','sms');
