INSERT INTO `settings` (`id`, `phone`, `mobile`, `facebook`, `twitter`, `mail`, `web`, `morning`, `afternoon`, `sepa_presenter_id`, `sepa_presenter_name`, `sepa_bbva_office`, `sepa_creditor_id`, `sepa_creditor_name`, `sepa_creditor_iban`, `enrollment_payment`, `monthly_payment`, `pass_price_list`, `job_status_discount`, `family_discount`, `information_clause`, `consent_clause`, `general_considerations_clause`, `cash_payments_clause`, `personal_data_consent_clause`, `faqs`, `instagram`, `flickr`) VALUES ('__main__','{\"phoneNumber\":\"956 05 93 44\",\"description\":\"Fijo\"}','{\"phoneNumber\":\"601 03 50 27\",\"description\":\"Movil\"}','AcademiabritanniaElpuerto','@AcademiaBritann','britannia.elpuerto.recepcion@gmail.com','https://www.academiabritannia.es','{\"end\": \"1970-01-01T10:30:00.000000Z\", \"start\": {\"date\": \"1970-01-01 09:00:00.000000\", \"timezone\": \"Europe/Madrid\", \"timezone_type\": 3}}','{\"end\": {\"date\": \"1970-01-01 20:30:00.000000\", \"timezone\": \"Europe/Madrid\", \"timezone_type\": 3}, \"start\": {\"date\": \"1970-01-01 16:30:00.000000\", \"timezone\": \"Europe/Madrid\", \"timezone_type\": 3}}','ES59000B72253271','ACADEMIA BRITANNIA EL PUERTO S.L.','6784','ES59000B72253271','ACADEMIA BRITANNIA EL PUERTO S.L.','ES51 0182 6784 1302 0158 4522',50,25,'a:3:{s:9:\"ten_hours\";O:25:\"PlanB\\DDD\\Domain\\VO\\Price\":1:{s:32:\"\0PlanB\\DDD\\Domain\\VO\\Price\0price\";d:10;}s:10:\"five_hours\";O:25:\"PlanB\\DDD\\Domain\\VO\\Price\":1:{s:32:\"\0PlanB\\DDD\\Domain\\VO\\Price\0price\";d:5;}s:8:\"one_hour\";O:25:\"PlanB\\DDD\\Domain\\VO\\Price\":1:{s:32:\"\0PlanB\\DDD\\Domain\\VO\\Price\0price\";d:1;}}','a:4:{s:7:\"student\";C:50:\"Britannia\\Domain\\VO\\Course\\Discount\\CourseDiscount\":51:{a:2:{s:8:\"discount\";i:5;s:14:\"freeEnrollment\";b:0;}}s:10:\"unemployed\";C:50:\"Britannia\\Domain\\VO\\Course\\Discount\\CourseDiscount\":51:{a:2:{s:8:\"discount\";i:5;s:14:\"freeEnrollment\";b:0;}}s:7:\"retired\";C:50:\"Britannia\\Domain\\VO\\Course\\Discount\\CourseDiscount\":51:{a:2:{s:8:\"discount\";i:5;s:14:\"freeEnrollment\";b:0;}}s:8:\"disabled\";C:50:\"Britannia\\Domain\\VO\\Course\\Discount\\CourseDiscount\":51:{a:2:{s:8:\"discount\";i:5;s:14:\"freeEnrollment\";b:0;}}}','a:3:{s:5:\"upper\";O:27:\"PlanB\\DDD\\Domain\\VO\\Percent\":1:{s:36:\"\0PlanB\\DDD\\Domain\\VO\\Percent\0percent\";i:0;}s:5:\"lower\";O:27:\"PlanB\\DDD\\Domain\\VO\\Percent\":1:{s:36:\"\0PlanB\\DDD\\Domain\\VO\\Percent\0percent\";i:5;}s:7:\"default\";O:27:\"PlanB\\DDD\\Domain\\VO\\Percent\":1:{s:36:\"\0PlanB\\DDD\\Domain\\VO\\Percent\0percent\";i:15;}}','<p>De acuerdo con lo establecido por el Nuevo Reglamento Europeo de Protección de Datos 679/2016 del 26 de Mayo de 2016 (RGPD), el cliente/usuario queda informado y presta su consentimiento al tratamiento de sus datos del que es responsable ACADEMIA BRITANNIA EL PUERTO, S.L. con la finalidad de prestarle información sobre los productos y servicios solicitados, así como el envío de comunicaciones comerciales sobre los mismos. Asimismo, le informamos de la posibilidad de ejercer los derechos de transparencia, acceso, rectificación, información, supresión, limitación del tratamiento, portabilidad y oposición de sus datos en el domicilio de ACADEMIA BRITANNIA EL PUERTO, S.L. sito en C/ CONCEJAL JUAN BOCANEGRA MUÑOZ Nº 11 LOCAL 2-. 11500 EL PUERTO DE SANTA MARÍA (CÁDIZ). Le informamos también que los datos personales suministrados no serán cedidos ni comunicados, ni siquiera para su conservación, a terceras personas.</p><p>Si usted no desea recibir nuestra información, póngase en contacto con nosotros enviando un correo electrónico a la siguiente dirección: britannia.elpuerto@gmail.com </p><br><p>Los importes de Docencia estan exentos de IVA, en base al articulo 20, apartado 1, número 9, de la ley 37/92 del dia 28/12 de la ley del IVA del artículo 7 Real Decreto 1624/92</p>','<p>que nuestro hijo/a aparezca en cualquiera de las diversas fotografías, imágenes y grabaciones que se tomen durante el tiempo que esté inscrito en ACADEMIA BRITANNIA EL PUERTO, S.L. Dichas imágenes podrán ser utilizadas para su publicación en:</p><ul><li>&nbsp;&nbsp;&nbsp; www.academiabritannia.es</li><li>&nbsp;&nbsp;&nbsp; Videos promocionales publicitarios</li><li>&nbsp;&nbsp;&nbsp; En nuestras redes sociales ( facebook, twitter, google plus, flickr, ...)</li></ul><br><p>La utilización de estas grabaciones y fotografías estarán limitadas exclusivamente a la promoción y publicidad de las actividades llevadas a cabo por ACADEMIA BRITANNIA EL PUERTO SL.</p><br><p>De acuerdo con lo establecido por el Nuevo Reglamento Europeo de Protección de Datos 679/2016 del 26 de Mayo de 2016 (RGPD), le informamos que los datos aportados serán incorporados a un tratamiento del que es titular ACADEMIA BRITANNIA EL PUERTO,S.L, con la finalidad de prestar a los alumnos los servicios profesionales solicitados,realizar la gestión administrativa, contable y fiscal, así como enviarle comunicaciones comerciales sobre nuestros productos y/o servicios.</p><br><p>Asimismo, declaro haber sido informado de la posibilidad de ejercer los derechos de acceso, rectificación, supresión, limitación del tratamiento, portabilidad y oposición de mis datos en el domicilio fiscal de ACADEMIA BRITANNIA EL PUERTO, S.L sito en C\\ CONCEJAL JUAN BOCANEGRA MUÑOZ 11 LOCAL 2 - 11500 EL PUERTO DE SANTA MARIA (CÁDIZ)</p>','<p><strong>Terminos y Condiciones 2019-2020</strong></p>&nbsp;<br><p>Este documento contiene la información necesaria para MATRICULARSE en nuestro Centro ( Academia Britannia El Puerto SL ). Su fin es contractual e informativo. Le rogamos lo lea con atención. En el caso de que haya algo que no entienda, por favor consulte con Recepción. El conjunto completo de normas en las que se establecen sus derechos y obligaciones como alumno/cliente están recogidas en este documento. Las normas y condiciones podrán cambiar, no sin antes comunicarlo a nuestros alumnos y clientes.&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; <br></p><p><br></p><p><strong>1. PROCESO DE INSCRIPCIÓN.</strong></p><p>Debe rellenar la Ficha de Inscripción del Alumno en su totalidad, durante el proceso le preguntaremos datos de contacto ( mínimo de dos personas, padres, tutores legales etc..), datos bancarios, forma de contacto, ya sea vía e-mail, llamadas teléfono, correo ordinario ). Le preguntaremos si en caso de que el alumno sea menor, nos autoriza a realizarle fotos, como norma cuando el Centro realiza alguna actividad, hacemos fotos y las subimos a nuestra página Web ( www.academiabritannia.es ) Facebook, Instragram etc… Para que los padres/tutores puedan verlas. Si usted no quiere que le hagamos fotos deberá comunicarlo a Recepción. *No se permite transferir la matrícula ( importe para la inscripción del alumno ) *Si el alumno tiene algún problema médico deberá comunicarlo para prestar la atención debida. &nbsp;</p><br><p><strong>2. PAGOS CURSOS/MENSUALIDADES/MATRICULAS.</strong></p><p>Los pagos de los cursos o mensualidades serán mediante DOMICILIACIÓN BANCARIA o TARJETA BANCARIA, caso de abonar las mensualidades con tarjeta, las fechas de pago serán del día 1 al 5. Academia Britannia realizará los cobros de las cuotas en dos fechas distintas en el mes en curso, el día 1 y el día 10. Si por algún motivo su entidad bancaría nos devolviera el recibo girado por Academia Britannia El Puerto SL se le aplicará la comisión bancaria por devolución que nos marque nuestra entidad bancaria.&nbsp;&nbsp; Si algún alumno/cliente por causa excepcional no puede domiciliar sus cuotas, deberá comunicarlo a Recepción, en este caso las fechas de pago serán del día 1 al día 5 del mes en curso.&nbsp;&nbsp; Academia Britannia El Puerto SL se pondrá en contacto con los alumnos/clientes que no abonen sus recibos en las fechas indicadas para recordarles su debido cumplimiento de pago, el día 6 de cada mes se les enviará un SMS con este fin. &nbsp;</p><p>Academia Britannia El Puerto SL se reserva el DERECHO DE ADMISIÓN a aquellos alumnos/clientes que no realicen el abono de las cuotas en los periodos establecidos, y por tanto, podrá de pleno derecho DENEGAR la entrada al Centro/Clase. El alumno/cliente queda informado de que Academia Britannia El Puerto SL. Tomará las medidas legales necesarias para reclamar el importe adeudado por el alumno/cliente. &nbsp;</p><p>Si Usted decide matricularse en nuestro Centro, tiene que realizar un 1º pago con los siguientes conceptos.</p><ul><li>“Matrícula” Al inscribirse en nuestro Centro. El importe de la matrícula no tiene devolución posible y no podrá ser transferido a otro cliente. Una vez ya ha abonado la matrícula en nuestro Centro no deberá abonarla más en cursos sucesivos.</li><li>“Final de Curso” Este concepto se refiere a la última cuota del curso, como norma 1º quincena de Junio del próximo año, caso de un curso específico con fecha de inicio y fin, se abonará la última mensualidad de dicho curso. Dicho importe no puede utilizarse para el abono de otro concepto, solo puede utilizarse este importe para su fin, que es el pago de la última mensualidad del curso contratado. A continuación exponemos un Ejemplo para lo que NO se podría utilizar el importe de Final de Curso--“el alumno quiere dejar de dar clases a mitad de mes y utilizar el importe de Final de Curso para abonar la quincena que ha venido a clase” </li><li>“1º Mensualidad” Este concepto como norma se refiere a la primera cuota del curso, como norma 2º quincena de Septiembre del año en curso, caso de un curso específico con fecha de inicio y fin, se abonará la mensualidad del mes en curso.</li><li>“Materiales” Este concepto se refiere a los materiales que utilizará el alumno durante el curso. Como norma el alumno utilizará un mínimo de dos libros para el curso, a veces incluso serán tres.&nbsp; &nbsp;</li></ul><p>Ninguno de los conceptos ( Matricula, Final de Curso, 1º Mensualidad, Materiales ) podrán ser reclamados para su posible devolución, independientemente del tiempo que permanezca matriculado en nuestro Centro.</p><p>Los conceptos ( Matricula, Final de Curso, 1º Mensualidad, Materiales ) no podrán ser transferidos a otro alumno, sea familiar o no lo sea. Los importes de los materiales serán distintos en función del curso, grupo, nivel, edad…</p><ul><li><strong>Cursos Intensivos.</strong>&nbsp; El importe de los cursos intensivos para la preparación de: A1/A2/B1/B2/C1, tanto de Cambridge como Aptis o cualquier otro Organismo Oficial, se abonará al matricularse en algunos de los cursos arriba mencionados. El alumno no podrá empezar ningún curso sin abonar el importe completo del curso, con la excepción de que el alumno se acoja a alguna oferta ofrecida por el Centro, si se acoge a alguna oferta, el alumno está obligado a abonar los importes en las fechas que el Centro tenga estipulado. Este importe no tiene devolución ni podrá ser transferido a otro alumno, siendo familiar del alumno o no, independientemente de si el alumno completa el curso intensivo o no lo completa.</li><li><strong>Cursos No Intensivos.</strong> Para matricularse en un curso No Intensivo. Para los cursos no intensivos el alumno/cliente tiene que realizar un 1º pago con los siguientes conceptos: Matrícula, Materiales, 1º quincena/mes dependiendo del día de la inscripción y final de curso. Ninguno de los conceptos mencionados tienen posible devolución ni tampoco podrán ser transferidos a ningún otro alumno/cliente sea o no sea familiar del alumno en cuestión.</li><li><strong>Grupos y Cursos de Adultos</strong> El Centro como norma oferta diferentes cursos durante el año, estos cursos se abrirán siempre y cuando haya un mínimo de 5 alumnos matriculados en dichos grupos, caso de no llegar al mínimo de 5 alumnos Academia Britannia se compromete a buscar otro grupo que se adecúe a las necesidades del alumno o si así lo prefiere se devolverá el importe a los alumnos ya inscritos.&nbsp;&nbsp; &nbsp;</li></ul>&nbsp; <p><strong><br></strong></p><p><strong>3.&nbsp; MATERIALES ( LIBROS ) PARA LOS CURSOS REALIZADOS EN ACADEMIA BRITANNIA.</strong></p><p>&nbsp;El material del alumno se adquiere en la Academia. El Centro es el encargado de entregar al Alumno los distintos materiales necesarios para realizar el curso en el que el Alumno se pueda inscribir, como norma, las editoriales suelen cambiar la versión de los libros anualmente, el Centro está continuamente actualizado, con lo cual todos los alumnos utilizarán la misma versión en el mismo año.&nbsp;&nbsp; <strong><br></strong></p><p><strong>NO SE PERMITE:</strong></p><ul><li>Libros fotocopiados ( ni hojas sueltas de los mismos ni encuadernados )&nbsp;&nbsp; <br></li><li>Libros en PDF descargados de Internet.<br></li><li>El uso compartido del material ( Cada alumno debe tener el suyo )</li><li>Libros no adquiridos en el centro.<br></li><li>USO DEL TELÉFONO MÓVIL.<br></li></ul><p>El uso del teléfono en nuestras instalaciones está prohibido, entendemos que debe ser un espacio libre de este u otro dispositivo que pueda distraer y entretener al alumno. Rogamos encarecidamente que si el alumno es acompañado por un adulto, dicho adulto se quede con el teléfono. El Centro en todo momento se pondrá en contacto con quien pudiera hacer falta llegado el momento de hacerlo. Si necesitan ponerse en contacto con el alumno podrán hacerlo rápidamente a través de los compañeros de recepción.</p>&nbsp;&nbsp; <br><p><strong>4-&nbsp;&nbsp; COMUNICACIÓN CON EL CENTRO. TUTORIAS/INFORMACIÓN SOBRE EL ALUMNO/BAJAS/MODIFICACIÓN DE DATOS…</strong></p><ul><li><strong>Como se comunicará Academia Britannia con el alumno/cliente.</strong> Para comunicarnos con el alumno/cliente lo haremos mediante diferentes plataformas, preferiblemente mediante correo electrónico. El Centro dispondrá de WhatsApp para enviar notificaciones, solo se utilizará para enviar mensajes, no sé responderá a los alumnos/clientes por este medio. Si prefieren otro medio de comunicación díganoslo.</li></ul><ul><li><strong>Información sobre el alumno</strong> Si solicita información del alumno ( trayectoria en el curso actual, faltas, calificaciones, etc.. ) Los padres/tutores han de solicitar esta información al Centro por los medios habilitados&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; para este caso. Academia Britannia El Puerto SL no tiene obligación de informar por mutuo propio. Pueden ponerse en contacto aquí. britannia.elpuerto.recepcion@gmail.com</li></ul><ul><li><strong>Petición de tutoría</strong>&nbsp; Los padres/Tutores pueden solicitar tutoría con la Dirección o viceversa, será La Directora del Centro quién se encargue de hacerlas una vez recopilada toda la información del alumno, para tal fin disponemos de un formulario el cual deberán rellenar y firmar, dicho formulario es muy importante que lo rellenen adecuadamente ya que en el mismo le haremos algunas preguntas relacionadas con la petición de la tutoría, le preguntaremos si quieren que nos pongamos en contacto vía e-mail, el 95% de las consultas se solucionan satisfactoriamente vía e-mail. No duden en ponerse en contacto con nosotros cuando le surja alguna duda. Si entiende que su consulta ha de ser de forma presencial intentaremos fijar la cita a la mayor brevedad posible. Nunca se atenderá a los padres en horario de clase para no interrumpir el normal desarrollo de las mismas. Pueden ponerse en contacto aquí.&nbsp; britannia.elpuerto.recepcion@gmail.com</li></ul><ul><li><strong>Comunicar una baja&nbsp;</strong> Para comunicar una baja de un alumno le indicamos la forma de hacerlo, siempre se hará por escrito, el Centro le facilitará los documentos necesarios.&nbsp; Tenemos que prestar especial atención a los siguientes criterios que Academia Britannia El Puerto SL ha establecido para este fin. La baja de cualquiera de los cursos en los cuales se ha matriculado el alumno deberá ser comunicada antes del día 15 del mes en curso, para hacerla efectiva el último día de dicho mes. Si no lo comunica en este periodo, es decir, comunica la baja a partir del día 15 del mes en curso, la baja será efectiva el siguiente mes, teniendo la obligación de abonar la próxima mensualidad, independientemente de que el alumno acuda a clase o no. Durante este tiempo el alumno tiene pleno derecho a acudir a sus clases con regularidad.</li><li>Recordarles que las clases asociadas al importe “ Final de Curso” no lo perderá el alumno. Podrá acudir al Centro la 1º Quincena de Junio para dar sus clases independientemente de cuando dejara de acudir al Centro, el único requisito para hacerlo será comunicarlo al Centro con al menos 15 días de antelación para poder ofrecerlo el mejor servicio posible. Academia Britannia El Puerto SL podrá reclamar los importes impagados por todos los medios legales necesarios.&nbsp; Pueden ponerse en contacto aquí: britannia.elpuerto.recepcion@gmail.com&nbsp;&nbsp; <br></li></ul><ul><li><strong>Modificación de datos</strong> Para modificar algún dato del alumno; dirección, tlf…. Etc, deberán hacerlo de forma presencial para poder firmar la modificación propuesta.&nbsp; <strong><br></strong></li></ul><p><strong><br></strong></p><p><strong>5-&nbsp;&nbsp; FALTAS DEL ALUMNO/DÍAS LECTIVOS/ DÍAS NO LECTIVOS/FESTIVOS</strong></p><p><strong>Faltas.</strong>&nbsp;&nbsp; <br></p><p>Las faltas del alumno deben ser justificadas, si no lo fueran, a la 3º falta Academia Britannia se pondrá en contacto con los padres/tutores para informarles. Recibirán una llamada del centro, si no le localizamos le enviaremos un e-mail y como último recurso un sms. Las faltas nunca son recuperables. En caso de faltar a un examen, por causa justificada y avisando con un mínimo de 24 horas de antelación acreditando justificante, el profesor valorará la necesidad de realizar el mismo, si fuese el caso, el examen se realizará en horario distinto al de su clase habitual. Caso de asistir a dicha propuesta, no se volverá a realizar otra. </p><p>&nbsp;Si el alumno falta un mes completo por motivos ajenos al Centro, el alumno está obligado a abonar la mensualidad con dos excepciones; </p><ol><li>Por motivos médicos que le imposibiliten acudir al centro, siempre acreditando con documentación expedida por el centro pertinente.</li><li>El alumno solicitará la baja del Centro siguiendo las instrucciones numeradas en el punto nº5. Academia Britannia de pleno derecho podrá poner su plaza a disposición de otro alumno que la requiera sin estar obligado ( el Centro ) a guardar la plaza una vez ha solicitado la baja del mismo </li></ol><p><strong>Días Lectivos, No Lectivos y Días Festivos. </strong></p><p>Los días Lectivos coinciden con los considerados como tales en el calendario escolar de nuestra localidad, si hay clase en el colegio/instituto hay clase en la Academia, de igual forma los Días No Lectivos coincidirán con los considerados como tales en el calendario escolar de nuestra Localidad, es decir sí NO hay clase en él colegio/Instituto NO hay clase en la Academia. Los Días Festivos coincidirán con los considerados como tales en el calendario escolar de nuestra Localidad, es decir sí NO hay clase en él colegio/Instituto NO hay clase en la Academia.&nbsp;&nbsp; Los horarios y precios están perfectamente ajustados para contemplar los días que no se impartirán clases. Los recibos que genera el Centro corresponden a mensualidades completas ( Con excepción de las Clases individuales ) independientemente de si el mes en curso tiene 4 semanas o 5 semanas, la mensualidad será la misma.</p><p><strong>6-&nbsp;&nbsp; ENTRADAS Y SALIDA DEL CENTRO</strong></p><p>Como norma, el alumno entrará al Centro ( 2 minutos ) antes del inicio de sus clases. Esto es fundamental para el normal desarrollo del Centro. Si el alumno/cliente tiene una necesidad especial, deberá comunicarlo al Centro. Pueden ponerse en contacto aquí. britannia.elpuerto.recepcion@gmail.com Academia Britannia El Puerto SL, tanto a la entrada como a la salida del alumno, no se hace responsable de los alumnos menores de edad que lleguen solos al Centro y lo abandonen de igual forma. Son los padres/tutores del mismo los que de forma voluntaria, aceptan que sus hijos menores de edad entren y salgan solos del Centro. Serán los padres/tutores los que tendrán que esperar en las puertas del Centro para la recogida de sus hijos, ya que el personal de Academia Britannia El Puerto SL no podrá abandonar el Centro.</p><p><strong>7- SOLICITUD DE DOCUMENTOS ACREDITATIVOS</strong></p><p>Si el alumno/cliente solicita algún documento acreditativo referente a expediente académico o de pago, debe saber que tiene un importe fijo que deberá ser abonado en el momento de la solicitud del mismo ( importe fijo 25€ )</p><p><strong>8-&nbsp;&nbsp; IVA EN RECIBOS O FACTURAS</strong></p><p>Academia Britannia El Puerto SL no emitirá ningún recibo en el cual se detalle IVA. Siguiendo instrucciones del artículo abajo detallado. *Los importes de Docencia están exentos de IVA, en base al artículo 20, apartado 1, número 9, de la ley 37/92 del día 28/12 de la ley del IVA del artículo 7 Real Decreto 1624/92</p><br><br><br>','<p>De acuerdo con lo establecido en el Nuevo Reglamento General de Protección de Datos Reglamento 2016/679, de 27 de abril de 2016, le informamos que el tratamiento de sus datos se gestionará por ACADEMIA BRITANNIA EL PUERTO, S.L. con la finalidad de prestar a los clientes los servicios profesionales solicitados, realizar la gestión administrativa, contable y fiscal, así como enviarle comunicaciones comerciales sobre nuestros productos y servicios. Asimismo, le informamos de la posibilidad de ejercer los derechos de acceso, rectificación, supresión, limitación del tratamiento, portabilidad y oposición de sus datos en el domicilio de ACADEMIA BRITANNIA EL PUERTO, S.L. sito en C/ CONCEJAL JUAN BOCANEGRA MUÑOZ Nº 11 LOCAL 2.-11500 EL PUERTO DE SANTA MARÍA-.(CÁDIZ).</p><p><em>*Los importes de Docencia estan exentos de IVA, en base al articulo 20, apartado 1, número 9, de la ley 37/92 del dia 28/12 de la leydel IVA del artículo 7 Real Decreto 1624/92</em></p>','<p><strong>1. ¿Quién es el responsable del tratamiento de sus datos?</strong></p><p>ACADEMIA BRITANNIA EL PUERTO, S.L. C/ CONCEJAL JUAN BOCANEGRA MUÑOZ Nº 11 LOCAL 2 - 11500 - EL PUERTO DE SANTA MARIA - CÁDIZ britannia.elpuerto@gmail.com</p><p><strong>2. ¿Con qué finalidad tratamos sus datos personales? </strong></p><p>En ACADEMIA BRITANNIA EL PUERTO, S.L. tratamos la información que nos facilitan las personas interesadas con el fin de Prestar a los alumnos los servicios profesionales solicitados,realizar la gestión administrativa, contable y fiscal, así como enviarle comunicaciones comerciales sobre nuestros productos y/o servicios</p><p><strong>3. ¿Por cuánto tiempo conservaremos sus datos?</strong></p><p>Se conservarán los datos durante 5 años.</p><p><strong>4. ¿Cuál es la legitimación para el tratamiento de sus datos?</strong></p><p>Le indicamos la base legal para el tratamiento de sus datos: </p><p>Ejecución de un contrato:</p><p><strong>5. ¿A qué destinatarios se comunicarán sus datos?</strong></p><p>No se cederán datos a terceros, salvo obligación legal.</p><p><strong>6. Transferencias de datos a terceros países </strong></p><p>No están previstas transferencias de datos a terceros países.</p><p><strong>7. ¿Cuáles son sus derechos cuando nos facilita sus datos? </strong></p><p>Cualquier persona tiene derecho a obtener confirmación sobre si en ACADEMIA BRITANNIA EL PUERTO, S.L. estamos tratando datos personales que les conciernan, o no. Las personas interesadas tienen derecho a acceder a sus datos personales, así como a solicitar la rectificación de los datos inexactos o, en su caso, solicitar su supresión cuando, entre otros motivos, los datos ya no sean necesarios para los fines que fueron recogidos. En determinadas circunstancias, los interesados podrán solicitar la limitación del tratamiento de sus datos, en cuyo caso únicamente los conservaremos para el ejercicio o la defensa de reclamaciones. En determinadas circunstancias y por motivos relacionados con su situación particular, los interesados podrán oponerse al tratamiento de sus datos. En este caso, ACADEMIA BRITANNIA EL PUERTO, S.L. dejará de tratar los datos, salvo por motivos legítimos imperiosos, o el ejercicio o la defensa de posibles reclamaciones. Si ha otorgado su consentimiento para alguna finalidad concreta, tiene derecho a retirar el consentimiento otorgado en cualquier momento, sin que ello afecte a la licitud del tratamiento basado en el consentimiento previo a su retirada. En caso de que sienta vulnerados sus derechos en lo concerniente a la protección de sus datos personales, especialmente cuando no haya obtenido satisfacción en el ejercicio de sus derechos, puede presentar una reclamación ante la Autoridad de Control en materia de Protección de Datos competente a través de su sitio web: www.agpd.es.</p><p><strong>8 . ¿Cómo hemos obtenido sus datos? </strong></p><p>Los datos personales que tratamos en ACADEMIA BRITANNIA EL PUERTO, S.L. proceden del propio interesado. No se tratan categorías especiales de datos personales (son aquellos datos que revelen el origen étnico o racial, las opiniones políticas, las convicciones religiosas o filosóficas, o la afiliación sindical, datos genéticos, datos biométricos dirigidos a identificar de manera unívoca a una persona física, datos relativos a la salud o datos relativos a la vida sexual o la orientación sexual de una persona física).</p>','<p><strong>1. ¿Es posible recuperar los días si mi hijo falta a clase?</strong></p><p>Las faltas nunca son recuperables, en caso de faltar a un exámen, por causa justificada, avisando con 24h de antelación y acreditando justificante, el profesor valorará la necesidad de realizar el mismo. Si fuese el caso el examen se realizará en horario distinto al de su clase habitual.</p><p><strong><br></strong></p><p><strong>2. ¿Que días no hay clase en la Academia?</strong></p><p>Tal y como pueden leer en las CONDICIONES GENERALES, en el punto nº5. No habrá clase los días que no haya colegio/instituto en nuestra Localidad.</p><p><strong><br></strong></p><p><strong>3. ¿Puedo recuperar las clases de los días que la Academia está cerrada?</strong></p><p>Los días que permanecemos cerrados no son recuperables, en nuestros precios y horarios tenemos contemplados dichos días, como podrán observar, hay meses de 4 semanas y otros de 5 semanas, nuestras mensualidades siempre serán las mismas independientemente de cuantas semanas tenga cada mes.</p><p><strong><br></strong></p><p><strong>4. Es posible utilizar el importe de final de curso para cualquier otro concepto?</strong></p><p>NO es posible, dicho importe solo puede ser utilizado para su finalidad.</p><p><strong><br></strong></p><p><strong>5. Si quiero dejar las clases a mitad de mes... ¿podría no pagar la cuota utilizando el importe de final de curso?</strong></p><p>NO es posible, como hemos mencionado en el anterior punto, dicho importe no podrá ser utilizado para ningún caso a excepción de dejar abonado la última quincena del curso al pagar la inscripción del curso en vigor.</p><p><strong><br></strong></p><p><strong>6. ¿Cómo tengo que tramitar la baja de la Academia?</strong></p><p>Como puede leer en el punto 4. de las CONDICIONES GENERALES será preciso comunicar la baja de la Academia antes de los días 15 de cada mes, de no ser así la baja será efectiva el mes siguiente, teniendo que abonar la mensualidad en curso.</p><p><strong><br></strong></p><p><strong>7. Si me doy de baja antes de finalizar el curso.. ¿pierdo el importe de Final de Curso?</strong></p><p>NO lo pierde, el alumno podrá venir la 1º quincena de Junio para dar clases, avisando con al menos 15 días de antelación&nbsp; para poder ofrecerle el mejor servicio posible.</p><p><strong><br></strong></p><p><strong>8. Si elijo forma de pago ( ABONO DE CURSO COMPLETO ) y dejo el curso antes de su finalización.. ¿puedo recuperar la parte proporcional ?</strong></p><p>NO es posible recuperar este importe, solo se podrá recuperar la parte proporcional con una excepción, por enfermedad que le imposibilite acudir al centro, siempre acompañado de justificante médico que lo acredite. Le aconsejamos que use el correo electrónico, de esta forma no tendrá que esperar si el teléfono está ocupado, nos pondremos en contacto a la mayor brevedad posible</p><p><strong><br></strong></p><p><strong>9. ¿Cual es la forma más rápida y práctica de ponerme en contacto con la Academia? Quisiera tener más información sobre&nbsp; la evolución académica de mi hijo/a ¿Que puedo hacer?</strong></p><p>Envíenos un e-mail exponiendo con brevedad el tema a tratar, le responderemos por la misma vía. Si aún así necesita visitarnos en persona, le daremos fecha y hora lo más rápido posible para concertar una cita.</p><p>EL 95% DE LAS CONSULTAS SE SOLUCIONAN SATISFACTORIAMENTE POR E-MAIL.</p><p><strong><br></strong></p><p><strong>10. ¿Los exámenes de Çambridge caducan ?</strong></p><p>Las titulaciones de Cambridge (KET, PET, FCE, CAE, CPE) son pruebas basadas en un nivel específico del Marco Común Europeo de Referencia para las Lenguas (MCER) y no tienen fecha de caducidad. Pueden consultar en:<br></p>https://www.cambridgeenglish.org/es/help/preguntas-frecuentes/<br><br>',NULL,NULL);
